import { BrowserRouter, Route, Routes } from "react-router-dom";

const Welcome = () => {
    return (
        <section>
            <h1>The Welcome Page</h1>
            <BrowserRouter>
            <Routes>
                <Route path="/welcome/new-user"> <p>welcome, new user!</p></Route>
            </Routes>
            </BrowserRouter>
        </section>
    )
};

export default Welcome;
